INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('5055936872295', 'Oats & Whey Flapjack', 'Mélange d\'Avoine [40%) [Flocons d\'Avoine), Avoine Grillée et Maltée [Flocons d\'Avoine Entiers, Huile de palme, Extrait de Malt d\'Orge)), Mélange de Protéines (16%) [Protéine de Lait, Concentrat de protéine de Whey (Lait)), Humectants [Glycerol, Maltitoll Collagène Hydrolysé, Glacage aromatisé au Chocolat au Lait [8%) [Edulcorants (Isomalt, Sucralose), Huile de Palme Non-Hydrogénée et de Palmiste, Poudre de Whey (Lait), Cacao en Poudre Maigre, Farine de Blé Enrichie (Farine de Blé, Carbonate de Calcium, Fer, Niacine, Thiamine), Emulsifiants [Lécithine de Soja, EL1761 Arôme Naturel), Isomalto-01igosaccharides, Arachides Concassées, Arôme, Huile de Colza, Sel, Colorant (Caramel Ordinaire), antioxydant [mélange de tocophérols naturels). Attention : Une consommation excessive peut avoir des effets laxatifs. Ne convient pas aux diabétiques. ALLERGÈNES: Pour les allergènes, incluant les céréales contenant du gluten, voir les ingrédients en gras. Peut également contenir des traces d\'oeuf, fruits à coques et dioxyde de souffre, INFORMATIONS IMPORTANTES: A conserver dans un endroit sec et frais à l\'abri de la lumière directe du soleil. Ce produit ne doit pas être utilisé comme substitut à un régime varié. A consommer dans le cadre d\'un régime équilibré et d\'un mode de vie sain. Non approprié aux végétariens.', 'https://static.openfoodfacts.org/images/products/505/593/687/2295/front_fr.4.400.jpg', '11', '3.9', '44', '4.4', '7.5', '26', '0.64', '0.251968503937008', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('5055936872349', 'PROTEIN BAR ELITE - Toffee Vanilla', 'FR Barre Protéinée saveur caramel vanille avec une couche et des morceaux de caramel, recouverte de chocolat au lait avec édulcorants. INGREDIENTS: Mélange de Protéines (19%) (Concentrat de Protéine de Whey (Lait), Protéine de Lait), Collagène Hydrolysé, Nappage Saveur Chocolat au Lait (149%), (Edulcorant (Isomalt, Sucralose), Huile de Palme et de Palmiste Non-Hydrogénée, Poudre de Whey (Lait), Poudre de Cacao Maigre, Farine de Blé Fortifiée (Farine de Blé, Carbonate de Calcium, Fer, Niacine, Thiamine), Emulsifiants (Lecithine de Soja, Polyricinoléate de polyglycérol), Arôme), Humectans (Glycerol, Malitol), Caramel Sans Sucres (10%) (Humidifiants (Glycerol, Malitol), Maltodextrine, Oligofructose, Eau, Huile de Coco, Poudre de Lait Ecrémé, Epaississant (Amidon de Mais Cireux Modifié), Colorant (Caramel Ordinaire), Agent Gelifiant (Pectine), Agent affermissant (Lactate de Calcium), Emulsifiant (Lecithine de Soja), Sel, Arôme, Epaississant (Gomme de Xanthane)), Isolat de Protéine de Soja, Fructo-Olisaccharides, Brisures de Caramel Sans Sucre (6%) (Edulcorants (Isomalt, Sirop de Malitol), Beurre (Lait), Eau, Sel, Arôme), Eau, Huile de Colza, Arôme, Antioxidant (Mélange de Tocopherols Naturels). Pour les allergènes, y compris les céréales contenant du gluten, voir ingrédients en gras. Peut contenir aussi l\'orge, l\'avoine, les ceufs, les arachides, les noix et le dioxyde de soufre. A conserver dans un endroit sec et frais, à l\'abris de la lumière directe du soleil. Ce produit ne doit pas être utilisé comme substitut à un régime varié. A consommer dans le cadre d\'un régime équilibré et d\'un mode de vie sain. Non approprié aux végétariens. Consommez comme une collation ou snack riche en protéines tout au long de la journée ou entre les repas (Par exemple entre le petit déjeuner et le déjeuner ou un aliment nutritif après-midi) pour augmenter votre apport quotidien en protéines. Ne convient pas aux végétariens.', 'https://static.openfoodfacts.org/images/products/505/593/687/2349/front_en.15.400.jpg', '9.5', '6.6', '34', '3.8', '5.6', '37', '0.4', '0.15748031496063', '', '1');

